//     "description": "<p>Alagba, la tortuga gigante considerada la más vieja de África, muere a los 344 años en el Palacio del Rey tradicional de la ciudad de Ogbomosho, en Nigeria.</p><h2>Se le atribuían poderes místicos y curativos.</h2><p>Alagba, una&nbsp;tortuga&nbsp;gigante considerada la más vieja de África y que se le atribuían poderes místicos y curativos, muere a los 344 años en el palacio del rey tradicional de la ciudad de Ogbomosho (suroeste de Nigeria), Oba Jimoh Oyewumi, informó su secretario privado, Toyin Ajamu.</p><p><img src=\"data:image/jpeg;base64,\"></p><p>Alagba, significa \"El Anciano\" en idioma Yoruba</p><p>De sexo masculino y cuyo nombre, Alagba, en el idioma yoruba significa \"El anciano\", falleció el pasado jueves 3 de octubre tras sufrir una breve enfermedad, precisó Ajamu, citado por los medios locales.</p><p>Vivió en el palacio durante siglos. La&nbsp;tortuga&nbsp;fue anfitriona de muchos monarcas en Ogbomosho \", aseguró el secretario privado.</p><h2>Tenía personal del palacio para su exclusiva atención.</h2><p>El animal, cuya especie se caracteriza por una gran longevidad, alcanzó popularidad porque el actual \"soun\" (título monárquico) \"usaba sus recursos personales para atender su bienestar\".</p><p>Actualmente, la&nbsp;tortuga&nbsp;\"tenía dos miembros del personal del palacio dedicados a ella\", dijo el secretario.</p><p>Esos sirvientes, indicó, le \"proporcionaban alimentos, asistencia médica y la logística para asegurarse de que recibía el mejor trato\".</p><p>\"Diario, había turistas que visitaban a Alagba desde diferentes partes del mundo\", apuntó Ajamu, quien remarcó que el palacio y el sector turístico \"están de luto por la muerte de Alagba\".</p><p>Con el fin de mantener en el recuerdo al popular reptil, el secretario adelantó que hay planes para preservar su cuerpo con la idea de que los turistas sigan disfrutando de su presencia.</p><p>Aparte de Alagba, la tortuga más antigua conocida fue Adwaita, una tortuga gigante de Aldabra que murió en 2006 y se cree que tenía 250 años.</p><p>Adwaita, que vivía en los Jardines Zoológicos de Alipore en Calcuta, India, supuestamente nació alrededor de 1750 y fue una de las cuatro tortugas que fue traída de vuelta a la India por los marineros británicos de las Seychelles como un regalo para Lord Clive.</p>",
